import React, { useState } from 'react';
import { Route, Switch } from 'react-router-dom';  
import Library from './Library';

const Main = ({ onImport }) => {
  return (
    <div className="flex-1 bg-gray-900 text-white p-6">
      <Switch>
        <Route path="/library">
          <Library onImport={onImport} />
        </Route>
      </Switch>
    </div>
  );
};

export default Main;
